"lang":"nl",
"name":"OP504: Een afgegeven budget kan ingekort of verlaagd worden.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"Herbeoordeling  inkorting/verlaging. Het wijzigen van een budget is op zich ook mogelijk door de budgetperiode in te korten (nieuwe einddatum &lt; einddatum) of het budget te verlagen (nieuw budget &lt; huidige bestedingen). Bij het doorgeven van een dergelijke wijziging is de budgetverstrekker aan extra regels gebonden vanwege het eventueel al besteedde budget. Voor de afhandeling van een toekenningsbericht is dit echter niet van belang. Als een bestedingsconflict ontstaat, dan verstuurt de verwerker van het bericht een budgetafsluitbericht naar de budgetverstrekker en ontstaat eventueel een declaratiestop."}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"JW501","id":223076,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW507","id":223056,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO507","id":223064,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WLZ507","id":223053,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO501","id":223073,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WLZ501","id":223070,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP504"}}}]
