"222486" : {
"id":222486,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV048: Waar bestaat het FunctieBudgetBesteed uit?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Dit bedrag is de som van bestedingen betreffende het BudgetNummer waaronder ze rechtsgeldig waren. Het betreft de geregistreerde bestedingen in de periode van de BestedingsPeriode/Ingangsdatum tot en met de BestedingsPeriode/Einddatum op het moment van het aanmaken van het 507-bericht. &nbsp;<p style=\"margin-top: 3pt;\">De bedragen worden als volgt samengesteld: <b><i></span><span style=\" font-size: 10pt; font-family: Verdana;\"></span><span style=\" font-size: 9pt; font-family: Verdana;\">&nbsp;<p style=\"margin-top: 3pt;\">FunctieBudgetBesteed</b></i> bevat het totaalbedrag dat op basis van de declaraties is uitbetaald vanuit dit Functiebudget. Dit is inclusief het verantwoordingsvrije bedrag dat is uitbetaald maar exclusief het eventueel bij dit functiebudget uitgekeerde ziekengeld en exclusief eventuele vrijwillige stortingen.&nbsp;<p style=\"margin-top: 3pt;\"><b><i>VerantwoordingsvrijBedragBesteed</b></i> bevat het totaalbedrag aan verantwoordingsvrije declaraties dat bij dit functiebudget is uitbetaald.&nbsp;<p style=\"margin-top: 3pt;\"><b><i>ZiekengeldBesteed</b></i> bevat het totaal aan ziekengeld dat door de betaalinstantie is uitgekeerd voor deze functiesoort als ziekengeld aan de zieke zorgverlener. Dit bedrag is niet meegerekend in het FunctieBudgetBesteed.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 9pt;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"JW507","id":223056,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO507","id":223064,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WLZ507","id":223053,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV048"}}}]
}
]
}
