"222514" : {
"id":222514,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV028: Hoe wordt een retourbestand opgesteld?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een retourbestand wordt gestuurd als ontvangstbevestiging van een heenbestand en bevat eventueel afgekeurde berichten (clienten) die niet voldoen aan de iStandaard. &nbsp;<p style=\"margin-top: 3pt;\">Een retourbestand wordt als volgt opgebouwd: &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Header: </b>&nbsp;<p style=\"margin-top: 3pt;\">* In de header wordt de BerichtCode gevuld met de berichtcode van het betreffende retourbericht. &nbsp;<p style=\"margin-top: 3pt;\">* De elementen Afzender en Ontvanger worden ongewijzigd overgenomen van de header van het heenbestand. &nbsp;<p style=\"margin-top: 3pt;\">* De header wordt aangevuld met identificerende gegevens van het retourbestand (IdentificatieRetour en DagtekeningRetour). &nbsp;<p style=\"margin-top: 3pt;\">* Alle berichtklassen, inclusief de header, worden uitgebreid met een berichtklasse RetourCodes. Daarbinnen kunnen &#233;&#233;n of meer retourcodes, horend bij de betreffende berichtklasse, worden opgenomen. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De volgende situaties kunnen zich voordoen: &nbsp;<p style=\"margin-top: 3pt;\">1. Alle heenberichten in een bestand zijn goedgekeurd: Het retourbestand bevat alleen een header. Er worden geen retourcodes opgenomen. &nbsp;<p style=\"margin-top: 3pt;\">2. Het aangeleverde bestand bevat &#233;&#233;n of meer berichten die inhoudelijk onjuist zijn: Het retourbestand bevat een header en de client of clienten die afgekeurd worden, inclusief alle berichtklassen behorend bij die client(en). Alle informatie over een client wordt ongewijzigd overgenomen. &nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;2a. Bij iedere berichtklasse wordt met retourcode(s) aangegeven wat er fout is.&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;2b. Berichtklassen die niet beoordeeld zijn, bijv. omdat in een bovenliggende berichtklasse een fout geconstateerd is, krijgen retourcode 0233 (Berichtklasse is niet beoordeeld).&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;2c. Berichtklassen waarin geen fouten zijn geconstateerd krijgen retourcode 0200 (Geen opmerking over deze berichtklasse). &nbsp;<p style=\"margin-top: 3pt;\">3. Indien het heenbestand technisch onjuist is, bijvoorbeeld indien het niet valideert tegen het XSD, kan in de Header een retourcode 0001 (Bericht is technisch onjuist) worden meegegeven. Alle onderliggende berichtklassen krijgen in dat geval retourcode 0233 (Berichtklasse is niet beoordeeld).&nbsp;<p style=\"margin-top: 3pt;\">4. Indien de ontvanger geen retourbericht kan maken, bijvoorbeeld omdat het bestand onleesbaar is, neemt de ontvanger buiten het berichtenverkeer om contact op met de verzender van het heenbericht.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"JW501","id":223076,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW507","id":223056,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO507","id":223064,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"PGB Retour","id":223067,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WLZ507","id":223053,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO501","id":223073,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WLZ501","id":223070,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV028"}}}]
}
]
}
