"lang":"nl",
"name":"OP501: Indien een nieuw budget wordt aangeleverd, met een verwijzing naar het oude budget, vervalt hiermee de geldigheid van het oude budget.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"Indien een wijziging wordt doorgegeven op een bestaand budget, wordt altijd de volledige, nieuwe situatie meegestuurd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De budgetverstrekker geeft de identificatie van het voorgaande budget mee. Alle FunctieBudgetten die in de eerdere aanlevering waren opgenomen, moeten opnieuw, volgens de nieuwe situatie, worden aangeleverd. Een FunctieBudget dat was aangeleverd in de eerdere aanlevering, maar niet meer voorkomt in de nieuwe situatie moet dus expliciet ingetrokken worden (budget op 0 euro en ingangsdatum gelijk aan einddatum)."}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"JW501","id":223076,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO501","id":223073,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WLZ501","id":223070,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP501"}}}]
