"lang":"nl",
"name":"TR514: Een FunctieBudgetBedrag van 0 euro moet een FunctieBudgetPeriode hebben waarbij de Einddatum gelijk is aan de oorspronkelijke of eerder aangeleverde Ingangsdatum.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een intrekking heeft altijd betrekking op een eerder toegekend budget. Gezien de definitie van de logische sleutel van een toekenning van een zorgfunctie is de einddatum van de intrekking gelijk aan de ingangsdatum van de intrekking. Dit is zo, omdat deze ingangsdatum gelijk is aan de ingangsdatum van de 'oorspronkelijke of eerder aangeleverde' ingangsdatum. Meer informatie over de werkwijze rondom intrekkingen in het proces is verwoord in bedrijfsregel OP505 en in scenario's 7, 8 en 9 in de excelsheet 'Negen scenario's' onder Casuistiek.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"LDT_RetourCode-Pgb","id":223137,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW501","id":223076,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO501","id":223073,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WLZ501","id":223070,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR514"}}}]
