"223089" : {
"id":223089,
"typeIconPath":"data/icons/ArchiMate/AllView.png",
"data" : [
{
"lang":"nl",
"name":"Afsluiten Budget",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<b><span style=\" font-size: 10pt;\">Wanneer wordt een budgetafsluitbericht verstuurd:&nbsp;<p style=\"margin-top: 3pt;\"></b>&nbsp;<p style=\"margin-top: 3pt;\">Het budgetafsluitbericht (507) wordt verstuurd om de verstrekker te informeren over de eindstand of tussenstand van de budgetuitputting. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">Er kunnen 3 redenen zijn voor het sturen van een budgetafsluitbericht bericht, te weten:&nbsp;<p style=\"margin-top: 3pt;\">1.&nbsp;&nbsp;&nbsp;&nbsp;De periode waarop een zorgfunctiebudget betrekking heeft is afgelopen.&nbsp;<p style=\"margin-top: 3pt;\">2.&nbsp;&nbsp;&nbsp;&nbsp;De bestedingen zijn hoger dan het toegestane zorgfunctiebudget of vallen buiten de budgetperiode.&nbsp;<p style=\"margin-top: 3pt;\">3.&nbsp;&nbsp;&nbsp;&nbsp;Als een zorgfunctiebudget is toegekend dat over de jaargrens loopt, dan wordt er na afloop van het kalenderjaar een budgetafsluitbericht verstuurd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Reden 1 : De periode waarop een zorgfunctiebudget betrekking heeft is afgelopen.</b>&nbsp;<p style=\"margin-top: 3pt;\">In dat geval dient er 14 weken na de datum waarop het zorgfunctiebudget is afgelopen een budgetafsluitbericht te worden verstuurd waarin de bestedingen staan vermeld die betrekking hebben op de gehele periode waarop dat zorgfunctiebudget betrekking heeft. Als reden van het bericht wordt &quot;Einddatum functiebudgetperiode&quot; vermeld.&nbsp;<p style=\"margin-top: 3pt;\">Er is voor een periode van 14 weken na de datum waarop het zorgfunctiebudget is afgelopen gekozen omdat dit de budgethouder de mogelijkheid geeft om alsnog declaraties in te dienen over de periode waarin het zorgfunctiebudget geldig was.&nbsp;<p style=\"margin-top: 3pt;\">Er is &#233;&#233;n uitzondering op deze regel, namelijk als de einddatum van een zorgfunctiebudget door een inkorting van de periode van het zorgfunctiebudget v&#243;&#243;r de verzenddatum van het toekenningsbericht ligt. In dat geval geldt de termijn van 14 weken vanaf de datum van versturen van het toekenningsbericht.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Reden 2 : De bestedingen zijn hoger dan het toegestane zorgfunctiebudget of vallen buiten de budgetperiode</b>&nbsp;<p style=\"margin-top: 3pt;\">Deze situatie doet zich voor in de volgende situaties:&nbsp;<p style=\"margin-top: 3pt;\">a.&nbsp;&nbsp;&nbsp;&nbsp;Er is een gewijzigd toekenningsbericht gestuurd waarbij de einddatum van het oorspronkelijke zorgfunctiebudget wordt vervroegd en daardoor een gedeelte van de bestedingen betrekking heeft op een periode na de nieuwe einddatum.&nbsp;<p style=\"margin-top: 3pt;\">b.&nbsp;&nbsp;&nbsp;&nbsp;Er is een nieuw toekenningsbericht gestuurd waarbij de begindatum van het oorspronkelijke zorgfunctiebudget later is dan de begindatum van de oorspronkelijke toekenning en daardoor een gedeelte van de bestedingen betrekking heeft op een periode v&#243;&#243;r de nieuwe begindatum.&nbsp;<p style=\"margin-top: 3pt;\">c.&nbsp;&nbsp;&nbsp;&nbsp;Er is een nieuw toekenningsbericht gestuurd waarbij het oorspronkelijke zorgfunctiebudget wordt verlaagd en daardoor wordt het totaal van de bestedingen hoger dan het toegestane budget.&nbsp;<p style=\"margin-top: 3pt;\">d.&nbsp;&nbsp;&nbsp;&nbsp;Een combinatie van bovengenoemde situaties.&nbsp;<p style=\"margin-top: 3pt;\">e.&nbsp;&nbsp;&nbsp;&nbsp;Er is een nieuw toekenningsbericht gestuurd waarin het oorspronkelijke zorgfunctiebudget wordt ingetrokken.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In alle bovengenoemde situaties dient er een budgetafsluitbericht gestuurd te worden met als reden &quot;bestedingsconflict - boven budget en/of buiten budgetperiode&quot;. Dit bericht moet 1 dag na de ontvangst van het nieuwe toekenningbericht worden verstuurd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Reden 3 : De periode waarvoor een zorgfunctiebudget is toegekend loopt over de jaargrens.</b>&nbsp;<p style=\"margin-top: 3pt;\">Deze situatie kan zich alleen voordoen bij een pgb dat toegekend is vanuit de Wmo of de Jeugdwet. Een toegekend budget vanuit de Wlz valt altijd binnen een kalenderjaar.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien deze situatie zich voordoet dan dient er 14 weken na de jaarovergang een budgetafsluitbericht te worden gestuurd met als reden &quot;administratieve jaarafsluiting&quot;.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\"></b>"}}]
}
]
}
