,
"229677" : {
"id":229677,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"Uitgangspunten, bedrijfsregels en technische regels komen in principe voort uit het proces, dat kan het clientproces of het berichtproces zijn.  Uitgangspunten worden gedefinieerd als ArchiMate principes en worden per standaard apart gedefinieerd. Een uitgangspunt wordt gerealiseerd door een of meer bedrijfsregels. Koppeling wordt gelegd door een realisatierelatie.  Bedrijfsregels worden gedefinieerd als ArchiMate requirements. Ze horen bij een proces (via associatierelatie) en/of bij n of meer berichten, via een modeloverstijgende associatie relatie met de berichtklasse root. Op een bedrijfsregel kunnen n of meer uitzonderingen gedefinieerd worden. Dit is een specialisatie van een bedrijfsregel. De uitzondering krijgt dezelfde regelcode als de regel waarop de uitzondering betrekking heeft met toevoeging van \"x\" en een volgnummer (zoals OP033x1). Bedrijfsregels worden indien mogelijk uitgewerkt in technische regels. Bedrijfsregels die niet zijn uitgewerkt in een technische regel kunnen als zodanig gemarkeerd worden in de profielinformatie (hier doen we op dit moment niks mee).  Technische regels worden gedefinieerd als ArchiMate beperkingen, met als profiel \"Technische regel\". Ze vormen de technische controleerbare vertaling van een bedrijfsregel. Iedere technische regel is dus ook gekoppeld aan (minstens) een bedrijfsregeleen associatie relatie. Let op: dit is een 'normale' associatierelatie, gn modeloverstijgende. Technische regels zijn van toepassing op een berichtklasse of een berichtelement via een modeloverstijgende associatierelatie. Bij een techische regels moet in de profielinformatie (\"niveau\") worden aangegeven of deze berichtoverstijgend is of niet (standaard).",
"type":"Tekenvorm",
"categories":[]
}
]
}
,
"229695" : {
"id":229695,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"Condities, constraints en invulinstructies zijn beperkingen of aanwijzingen op de gegevens die gevuld moeten of mogen worden.  Condities worden gedefinieerd als ArchiMate beperkingen, met als profiel \"Conditie\". Condities worden gekoppeld aan een berichtelement of aan een attribuut binnen een composite datatype. Op dit moment worden condities alleen gekoppeld aan het element dat daadwerkelijk beperkt wordt, niet aan het element op basis waarvan de beperking geldig is.  Constraints worden gedefinieerd als ArchiMate beperkingen, met als profiel \"Constraint\". Constraints worden gekoppeld aan een berichtelement of aan een attribuut binnen een composite datatype. Een constraint kan ook gekoppeld worden aan een datatype, hoewel dan een xsd restrictie meer voor de hand ligt.  Een xsd restrictie is een specialisatie van een constraint en daarmee ook een Archimate beperking met profiel \"constraint\". Xsd restricties worden altijd vertaald als een restrictie op een datatype in het xsd. Deze worden altijd gekoppeld aan een logisch datatype.  Invulinstructies worden gekoppeld aan een berichtelement of aan berichtklasse root (alleen voor Retourbericht invulinstructie)",
"type":"Tekenvorm",
"categories":[]
}
]
}
,
"229697" : {
"id":229697,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"Alle regels worden gedefinieerd binnen de ArchiMate laag \"Motivatie\". Regels worden met modeloverstijgende associatierelaties gekoppeld aan het 'gegevensstuk' (in UML). Dit gebeurt op een zo laag mogelijk niveau: indien overal dezelfde beperking geldt aan het datatype, anders aan berichtelement of -klasse.  In het model wordt voor iedere standaard een AchiMate model gemaakt met daarin per regelsoort een 'motivatielaag' met de regels. Daarnaast is er een model 'Generieke regels' met regels die in iedere standaard terugkomen. Bij een generieke regel is evt. mogelijk om per standaard een specialisatie te maken, bijv. wanneer een andere retourcode van toepassing is. In de publicatielaag (inSite) worden tabellen gemaakt per standaard; deze tabellen worden gevuld op basis van de regels die binnen n of meer 'motivatielagen' zijn opgenomen. Welke lagen getoond moeten worden is per tabel in te stellen.  Regels krijgen als titel: \"Code: Beknopte omschrijving.\" Uitgebreidere omschrijving en verdere uitleg kan in de documentatie worden opgenomen. In de profielinformatie moet (handmatig!) de code van de regel ingevuld worden.",
"type":"Tekenvorm",
"categories":[]
}
]
}
