"228152" : {
"id":228152,
"typeIconPath":"data/icons/ArchiMate/BusinessRole.png",
"data" : [
{
"lang":"nl",
"name":"Zorgkantoor regionaal",
"type":"Bedrijfsrol",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Elk zorgkantoor heeft een eigen regio als werkgebied. In die regio voert het zorgkantoor de regie over de uitvoering van de Wlz. Een belangrijke taak is het toewijzen van zorg. Daarvoor maakt het zorgkantoor contractafspraken met zorgaanbieders en ziet erop toe dat een client met een geldig indicatiebesluit op een efficiente manier passende zorg krijgt (zorglevering). Het zorgkantoor kan met de zorgaanbieders afspreken hoe deze de zorgtoewijzing uitvoeren, maar blijft daar wel in alle gevallen eindverantwoordelijk voor. Het zorgkantoor is het informatieknooppunt in de regio en zorgt ervoor dat de keten goed functioneert. Het bewaakt de doorlooptijden van het berichtenverkeer en de kwaliteit van de informatie die de ketenpartners uitwisselen. Ten slotte stelt het zorgkantoor met behulp van de iWlz de regionale wachtlijst samen en levert het zorgkantoor periodiek gegevens aan voor de landelijke wachtlijstrapportage.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
,
"228148" : {
"id":228148,
"typeIconPath":"data/icons/ArchiMate/BusinessRole.png",
"data" : [
{
"lang":"nl",
"name":"CIZ",
"type":"Bedrijfsrol",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Iemand die Wlz-zorg nodig heeft (de client), meldt zich bij het indicatieorgaan in de regio waarin hij woont. Het CIZ vervult de functie van indicatieorgaan. Het CIZ beoordeelt op basis van de zorgbehoefte van de client of deze in aanmerking komt voor Wlz-zorg en controleert tevens bij de SVB of de client recht heeft op Wlz zorg. Zo ja, dan ontvangt de client een indicatiebesluit waarin vermeld staat op welke zorg de client recht heeft. Het CIZ heeft ook de taak na te gaan wat de voorkeuraanbieder is van de client en welke leveringsvorm zijn voorkeur heeft (ZIN, PGB, VPT). Het CIZ kan andere organisaties of deskundigen inschakelen bij de indicatiestelling, maar blijft wel eindverantwoordelijk voor (de kwaliteit van) de indicatiebesluiten. Het CIZ stuurt het indicatiebesluit in de vorm van een iStandaarden bericht (IO31) naar het zorgkantoor.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
,
