"227108" : {
"id":227108,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"Gebruik het viewpoint \"Genereer bericht xsd v#.#\" voor het genereren van de XML schema definitie voor een bericht n het bijbehorende retourbericht.  De xsd's worden gegenereerd op basis van de geselecteerde view. Voor de betreffende view worden alle berichtklassen afgelopen volgens de getekende relaties.  Als de juiste gegevens en modelvoorwaarden zijn ingevuld, wordt een retourbericht altijd samen met het heenbericht gegenereerd. Deze voorwaarden zijn:  Er moet n UML-klasseview genaamd \"Retourbericht Template\" in het modelpackage aanwezig zijn.  Op de Retourbericht Template view moeten klassen met de naam RootClass en MessageClass voorkomen.  Op de Rootklasse van het hnbericht moeten de eigenschappen Naam Retourbericht en Code Retourbericht ingevuld zijn. Deze waarden worden gebruikt in plaats van de waarden voor naam en berichtcode van het heenbericht.  RootClass en MessageClass representeren de generieke klassen die in een bericht worden gebruikt.; RootClass komt 1 keer voor in elk bericht.  MessageClass staat voor alle klassen in het bericht die niet de root klasse zijn.  De klassen Retourcode en Header komen overeen met klassen die in een bericht worden gebruikt met die naam.  Wanneer een klasse met dezelfde naam voorkomt op het retourtemplate, dan worden de attributen en relaties met cardinaliteit toegevoegd aan die specifieke klasse. Wanneer een klassenaam niet voorkomt op het retourtemplate, dan worden de relaties met cardinaliteit en attributen van MessageClass toegevoegd aan de berichtklasse. De rootklasse krijgt altijd de relaties en attributen van de klasse RootClass in het template.  De Client klasse krijgt een andere cardinaliteit mee, dit is \"hardcoded\" opgenomen in het script. Voor Client wordt de cardinaliteit in het retourbericht gesteld op 0..* voor Wlz en op 0..1 voor overige modellen.   Wanneer een basisschema wordt gegenereerd en er is een retourtemplate aanwezig in het modelpackage, dan worden altijd alle gebruikte datatypes in het retourtemplate in het basisschema gezet. Zo kan er altijd over de juiste types beschikt worden.",
"type":"Tekenvorm",
"categories":[]
}
]
}
