"227102" : {
"id":227102,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"Gebruik het viewpoint \"Genereer regeloverzicht voor model\" om voor n model te rapporteren welke regels waar van toepassing zijn.  Het viewpoint genereerd een Excel bestand met twee tabbladen: 1: Regels per bericht(element): voor ieder bericht in het model (o.b.v. de views) wordt weergegeven welke regels gekoppeld zijn op bericht, op berichtklasse of op berichtelement. De titel en de code van de regel wordt opgenomen in de output. 2: Regels: hierin staan uniek genoemd alle regels die van toepassing zijn op n model. Regeltype, -code, titel, documentatie en de evt. XSD restrictie regel worden opgenomen in de output.  Dit script genereert een regeltabel per element en eigenschappentabel voor alle gebruikte regels in een geselecteerd model.  Voor alle objecten in het geselecteerde model worden de gekoppelde regels opgehaald, en worden de aan gebruikte datatypes gekoppelde regels opgehaald. Het resultaat zijn twee worksheets in een excel venster, dat opgeslagen kan worden als een document.  De sheet Regels per bericht(element) bevat voor ieder object zijn gekoppelde regels, voor attributen wordt gespecificeerd voor welk van de gebruikte datatypes de regel is gekoppeld  De sheet Regels bevat alle regels die zijn gekoppeld, gesorteerd op type regel.  Dit script moet voor elke publicatie van het regelrapport uitgevoerd worden en het resultaat gepubliceerd. Ook kan het resultaat gebruikt worden voor inhoudelijke controle van de regels in het model.",
"type":"Tekenvorm",
"categories":[]
}
]
}
