"232921" : {
"id":232921,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"De keten van Pgb processen start op het moment dat een client een aanvraag doet voor een persoonsgebonden  budget voor de zorg en ondersteuning. De client doet de aanvraag bij de budgetverstrekker, een gemeente of  zorgkantoor.   Als de aanvraag voor zorg en ondersteuning wordt goedgekeurd aan de client wordt er een budget toegekend. De  gemeente of het zorgkantoor stuurt hierop een toekenningsbericht naar de betaalinstantie (toekennen budget). De  geleverde zorg en ondersteuning wordt door de budgethouder gedeclareerd of gefactureerd bij de betaalinstantie  (uitvoeren trekkingsrechten, besteden budget) volgens de geldende contractafspraken (afsluiten & beoordelen zorgovereenkomst). 14 weken na het einde van de budgetperiode stuurt de betaalinstantie een budgetafsluitbericht  naar de budgetverstrekker, de gemeente of het zorgkantoor (afluiten budget).",
"type":"Tekenvorm",
"categories":[]
}
]
}
